// === PARSE DE FILTROS ===
let filtros;
try {
  let raw = $json.output || $json;
  if (typeof raw === 'object') {
    filtros = raw;
  } else {
    const clean = raw.replace(/```json\s*|\s*```/g, '').trim();
    filtros = JSON.parse(clean);
  }
} catch (e) {
  console.log('‚ùå Erro ao parsear filtros:', e);
  filtros = {};
}

// === NORMALIZA√á√ÉO DE TEXTOS (corrige h√≠fens e espa√ßos inconsistentes) ===
const normalizeText = (str) => {
  if (!str) return str;
  return str
    .replace(/[‚Äì‚Äî]/g, '-') // substitui travess√µes por h√≠fen comum
    .replace(/\s+/g, ' ')   // normaliza m√∫ltiplos espa√ßos
    .trim();
};

// Normaliza todos os campos textuais dos filtros
const camposTextuais = ['tipo_custo', 'area', 'departamento', 'centro_de_custo', 'cargo', 'empresa'];
for (const campo of camposTextuais) {
  const val = filtros[campo];
  if (Array.isArray(val)) {
    filtros[campo] = val.map(v => normalizeText(v));
  } else if (typeof val === 'string') {
    filtros[campo] = normalizeText(val);
  }
}

// === L√ìGICA DE PER√çODO (MM/YYYY) ===
const now = new Date();
let mesInicio, mesFim;
if (filtros.mes_inicio && filtros.mes_fim) {
  mesInicio = filtros.mes_inicio;
  mesFim = filtros.mes_fim;
} else {
  const fim = new Date(now);
  const inicio = new Date(now);
  inicio.setMonth(inicio.getMonth() - 2);
  mesInicio = `${String(inicio.getMonth() + 1).padStart(2, '0')}/${inicio.getFullYear()}`;
  mesFim = `${String(fim.getMonth() + 1).padStart(2, '0')}/${fim.getFullYear()}`;
}

// === CONVERTE MM/YYYY ‚Üí YYYYMM (inteiro) ===
function mmyyyyToYYYYMMInt(mmyyyy) {
  if (!mmyyyy || typeof mmyyyy !== 'string') return null;
  const [mm, yyyy] = mmyyyy.trim().split('/');
  return /^\d{2}$/.test(mm) && /^\d{4}$/.test(yyyy)
    ? parseInt(`${yyyy}${mm}`, 10)
    : null;
}
let startInt = mmyyyyToYYYYMMInt(mesInicio);
let endInt = mmyyyyToYYYYMMInt(mesFim);
if (startInt && endInt && startInt > endInt) [startInt, endInt] = [endInt, startInt];

// === HELPERS ===
const escapeSql = (str) => (str == null ? '' : String(str).replace(/'/g, "''"));
const toInClause = (arr) => arr.map(v => `'${escapeSql(v)}'`).join(', ');
const filtroCampoSQL = (alias, campo, valor) =>
  !valor ? '' : Array.isArray(valor)
    ? ` AND ${alias}.[${campo}] IN (${toInClause(valor)})`
    : ` AND ${alias}.[${campo}] = '${escapeSql(valor)}'`;

// === FILTROS ===
let tipoCustoFiltro = '';
if (filtros.tipo_custo && filtros.tipo_custo !== 'todas') {
  tipoCustoFiltro = Array.isArray(filtros.tipo_custo)
    ? ` AND r.[Tipo_Custo] IN (${toInClause(filtros.tipo_custo)})`
    : ` AND r.[Tipo_Custo] = '${escapeSql(filtros.tipo_custo)}'`;
}

let departamentoFiltro = '';
if (filtros.departamento) {
  departamentoFiltro = Array.isArray(filtros.departamento)
    ? ` AND c.[Departamento] IN (${toInClause(filtros.departamento)})`
    : ` AND c.[Departamento] = '${escapeSql(filtros.departamento)}'`;
}

// === AGRUPAMENTO ===
let agrupamento = [`LTRIM(RTRIM(r.[Mes_ref_folha])) AS Mes`];
let groupBy = [`LTRIM(RTRIM(r.[Mes_ref_folha]))`];
if (filtros.departamento) {
  agrupamento.push('c.[Departamento]');
  groupBy.push('c.[Departamento]');
}
if (filtros.tipo_custo && filtros.tipo_custo !== 'todas') {
  agrupamento.push('r.[Tipo_Custo]');
  groupBy.push('r.[Tipo_Custo]');
}

// === FILTRO TEMPORAL ===
let filtroTemporal = '';
if (startInt && endInt) {
  filtroTemporal = startInt === endInt
    ? `AND LTRIM(RTRIM(r.[Mes_ref_folha])) = '${mesInicio}'`
    : `AND CAST(RIGHT(LTRIM(RTRIM(r.[Mes_ref_folha])),4) + LEFT(LTRIM(RTRIM(r.[Mes_ref_folha])),2) AS INT)
       BETWEEN ${startInt} AND ${endInt}`;
}

// === QUERY BASE ===
let query;

// üí∞ Caso 1: Total gasto
if (filtros.metrica === 'total_gasto' || !filtros.metrica) {
  const precisaJoin = !!(filtros.departamento || filtros.area || filtros.cargo || filtros.centro_de_custo || filtros.empresa);
  if (precisaJoin) {
    query = `
      SELECT ${agrupamento.join(', ')}, SUM(r.[Valor]) AS Total_Gasto
      FROM [vw_Rubricas_Classificadas] r
      LEFT JOIN [RhTech_fake_Colaboradores] c
        ON REPLACE(REPLACE(REPLACE(c.[CPF], '.', ''), '-', ''), ' ', '') =
           REPLACE(REPLACE(REPLACE(r.[CPF], '.', ''), '-', ''), ' ', '')
      WHERE 1=1
      ${tipoCustoFiltro} ${departamentoFiltro}
      ${filtroCampoSQL('c', '√Årea', filtros.area)}
      ${filtroCampoSQL('c', 'Cargo', filtros.cargo)}
      ${filtroCampoSQL('c', 'Centro_de_Custo', filtros.centro_de_custo)}
      ${filtroCampoSQL('c', 'Nome_da_Empresa', filtros.empresa)}
      ${filtroTemporal}
      GROUP BY ${groupBy.join(', ')}
      ORDER BY Mes DESC;
    `;
  } else {
    query = `
      SELECT ${agrupamento.join(', ')}, SUM(r.[Valor]) AS Total_Gasto
      FROM [vw_Rubricas_Classificadas] r
      WHERE 1=1 ${tipoCustoFiltro} ${filtroTemporal}
      GROUP BY ${groupBy.join(', ')}
      ORDER BY Mes DESC;
    `;
  }
}

// üèÜ Caso 2: Ranking
else if (filtros.metrica === 'ranking') {
  let campoRanking = 'c.[Departamento]';
  if (filtros.cargo) campoRanking = 'c.[Cargo]';
  else if (filtros.area) campoRanking = 'c.[√Årea]';
  else if (filtros.centro_de_custo) campoRanking = 'c.[Centro_de_Custo]';
  else if (filtros.empresa) campoRanking = 'c.[Nome_da_Empresa]';

  query = `
    SELECT ${campoRanking} AS Categoria, SUM(r.[Valor]) AS Total_Gasto
    FROM [vw_Rubricas_Classificadas] r
    INNER JOIN [RhTech_fake_Colaboradores] c
      ON REPLACE(REPLACE(REPLACE(c.[CPF], '.', ''), '-', ''), ' ', '') =
         REPLACE(REPLACE(REPLACE(r.[CPF], '.', ''), '-', ''), ' ', '')
    WHERE 1=1
      ${tipoCustoFiltro}
      ${filtroCampoSQL('c', '√Årea', filtros.area)}
      ${filtroCampoSQL('c', 'Departamento', filtros.departamento)}
      ${filtroCampoSQL('c', 'Centro_de_Custo', filtros.centro_de_custo)}
      ${filtroCampoSQL('c', 'Cargo', filtros.cargo)}
      ${filtroCampoSQL('c', 'Nome_da_Empresa', filtros.empresa)}
      ${filtroTemporal}
    GROUP BY ${campoRanking}
    ORDER BY SUM(r.[Valor]) DESC;
  `;
}

// üìã Caso 3: Consulta detalhada
else {
  query = `
    SELECT TOP 10000
      REPLACE(REPLACE(REPLACE(c.[CPF], '.', ''), '-', ''), ' ', '') AS CPF_Limpo,
      c.[Nome], c.[Cargo], c.[Departamento], c.[Centro_de_Custo],
      c.[Sal√°rio], c.[Vale_Refei√ß√£o], c.[Nome_da_Empresa], c.[√Årea],
      r.[C√≥digo_Rubrica], r.[Descri√ß√£o_Rubrica], r.[Descri√ß√£o_Natureza_Rubrica],
      r.[Tipo_Custo], r.[Valor], r.[Mes_ref_folha]
    FROM [RhTech_fake_Colaboradores] c
    LEFT JOIN [vw_Rubricas_Classificadas] r
      ON REPLACE(REPLACE(REPLACE(c.[CPF], '.', ''), '-', ''), ' ', '') =
         REPLACE(REPLACE(REPLACE(r.[CPF], '.', ''), '-', ''), ' ', '')
    WHERE 1=1
      ${tipoCustoFiltro} ${departamentoFiltro}
      ${filtroCampoSQL('c', '√Årea', filtros.area)}
      ${filtroCampoSQL('c', 'Cargo', filtros.cargo)}
      ${filtroCampoSQL('c', 'Centro_de_Custo', filtros.centro_de_custo)}
      ${filtroCampoSQL('c', 'Nome_da_Empresa', filtros.empresa)}
      ${filtroTemporal}
    ORDER BY r.[Mes_ref_folha] DESC, c.[Nome], r.[C√≥digo_Rubrica];
  `;
}

// === DEBUG ===
console.log('‚úÖ Query gerada:', query);
console.log('üìä Filtros:', JSON.stringify(filtros, null, 2));
console.log('üóìÔ∏è Per√≠odo:', mesInicio, '‚Üí', mesFim, `(as ints ${startInt} ‚Üí ${endInt})`);

return [{ json: { query, filtrosAplicados: filtros, usaFiltroNumerico: !!(startInt && endInt) } }];

